Some function can return many different output types, such as tuples or lists, or different single values, and they expect you to handle them just the same. This works thanks to the BEAM's run-time support for pattern-matching on values of different kinds. When doing static typing, we say these functions return Union Types. Caramel does not support Union Types, so functions like this one: -spec f(integer()) :: none | {integer(), integer(), integer()} | binary().
f(0) -> none;
f(1) -> {1234, 5678, 9};
f(2) -> <<"TEN!">>. That can return either an atom, like none, or a triple of integers, or a binary string, can not be called directly . Instead we have to choose to pay a small cost for runtime typing, or to restrict the values coming from Erlang. Restricting Values If we know that the returned values from the Erlang code are tagged tuples , on any level of nesting, and we can map them to a type in Caramel, then we can simplify the process by declaring the type on the Caramel side and letting the compilation process match the structures. For example, if the function from before returned: -spec f(integer()) :: {atom, none} | {triple, {integer(), integer(), integer()}} | {string, binary()}.
f(0) -> none;
f(1) -> {1234, 5678, 9};
f(2) -> <<"TEN!">>. We can bind to it by writing out the type first: type none = None
type f_return = | Atom of None | Triple of int * int * int | String of string external f : int -> f_return = "" Fortunately plenty of Erlang code heavily relies on tagged tuples for runtime pattern matching. When it doesn't, we have to do the typing at runtime ourselves. Runtime Typing Paying a small cost means that we have to add some runtime inspection of values to decide what types they actually have. This is not a big deal because it is something we do in Erlang all the time anyways, but it certainly means that calling these Erlang functions is not a zero cost operation. For example, we can use the functions in the Erlang module to check if the return value is of some type: type unknown
external __unsafe_f : int -> unknown = "f" type f_values = | Binary of string | Atom of string | Triple of (int * int * int) let f : int -> f_values = fun i -> let x = __unsafe_f i in if Erlang.is_binary x then Binary (unsafe_cast x) else if Erlang.is_atom x then Atom (unsafe_cast x) else if Erlang.is_tuple x 3 then Triple (unsafe_cast x) else panic At this point, we could add a lot more validation logic to our f function to try to make 100% sure that the value we have is of the type we expect. This process can be error prone, and certainly relies on the Erlang code never returning any value that we didn't account for. It is worth noting that this can also be done on the Erlang side , perhaps even more idiomatically, by tagging the values: tagged_f(X) -> case f(X) of none -> {atom, none}; {_, _, _} -> {triple, X}; Y when is_binary(Y) -> {string, Y} end. After this we can use the Restricting Values approach.
